How to sync a async operation in java<p>I am currently creating a database util class but my mongodb driver is async, my question now is how can I sync him? My current try looks something like this:</p>

<pre><code>public boolean isBanIDFree(String banid) {
    boolean value = false;
    Thread thread = Thread.currentThread();
    MongoCollection&lt;Document&gt; collection = database.getCollection("Bans");
    collection.find(new Document("ID", banid)).first(new SingleResultCallback&lt;Document&gt;() {

        @Override
        public void onResult(Document result, Throwable t) {
            if(result == null) {
                value = true;
            }
                thread.notify();

        }
    });
    try {
        thread.wait();
    } catch (InterruptedException e) {
        e.printStackTrace();
    }

    return value;
}
</code></pre>

<p>but I can't edit the veriable value in the onResult Callback, how can I bypass this. i want to return a boolean and want the calling thread to wait until I got the response from the database</p>

